const Total = ({ sum }) => <p>Number of exercises {sum}</p>

const Part = ({ part }) =>
    <p>
        {part.name} {part.exercises}
    </p>

const Content = ({ parts }) =>
    <>
        <Part
            part={parts[0]}
        />
        <Part
            part={parts[1]}
        />
        <Part
            part={parts[2]}
        />
    </>

const Course = (course) =>
    <div>
        <Header course={course.name} />
        <Content parts={course.parts} />
        {/*<Total sum={parts[0].exercises + parts[1].exercises + parts[2].exercises} />*/}
    </div>

const App = () => {
    const course = {
        id: 1,
